import React from "react";

function Homepage(props) {
	return (
		<React.Fragment>
			<div className="container">
				<div className="row">
					<div className="col-12">
						<h1>Homepage</h1>
					</div>
				</div>
			</div>
		</React.Fragment>
	);
}

export default Homepage;
